import { jsPDF } from "jspdf";
import { snakeCaseToTitleCase } from "./functions";

// Creating a document
const pdf = new jsPDF({
  orientation: "portrait", // should it be portrait or landscape?
  unit: "cm", // unit of measure while adding stuff
  format: "a4", // format can be string or array [x, y] in above units
});

const logoTest =
  "data:image/jpeg;base64,";
const alterTextForForm = (text: string) => {
  const removedCharacters = text
    .replace(/{/, "")
    .replace(/}/gm, "")
    .replace(/"|'/gm, "")
    .replace(/:/gm, ": ");
  return removedCharacters
    .replace(/([a-z])([A-Z])/g, "$1 $2")
    .split(",")
    .map((i) => snakeCaseToTitleCase(i));
};
const date = new Date().toDateString();
const createPdf = async (obj: string, subject: string) => {
  pdf.addImage(logoTest, "JPEG", 1, 1, 6, 3);

  // Inserting text
  pdf.setTextColor(0, 0, 0);
  pdf.setFontSize(30);
  pdf.text(subject, 1, 6);
  // Adding informations
  pdf.setTextColor(0, 0, 0);
  pdf.setFontSize(14);
  pdf.text("Date:", 1, 7);
  pdf.setFontSize(14);
  pdf.text(date, 3, 7);
  pdf.text(alterTextForForm(obj), 1, 9.5);

  const pdfOutput = pdf.output("datauristring");

  return pdfOutput;
};

// createPdf("", "");

export default createPdf;
